import React from 'react'

function App() {
  return (
    <div>
      <form method="post" action="/run" encType="multipart/form-data">
        <input
          type="file"
          name="file"
        />
        <button type="submit" disabled={!file}>Submit</button>
      </form>
    </div>
  );
}

export default App;
